import java.util.ArrayList;
import java.util.List;
import java.util.Scanner;

public class Main {
	public static void main(String[] args) {
		Scanner sc = new Scanner(System.in);
		int n = sc.nextInt();
		ArrayList<List> A = new ArrayList<>();
		for (int i = 0; i < n; i++) {
			ArrayList B = new ArrayList<>();
			A.add(B);
		}
		int q = sc.nextInt();
		for (int i = 0; i < q; i++) {
			int x = sc.nextInt();
			if (x == 0) {
				int y = sc.nextInt();
				int z = sc.nextInt();
				A.get(y).add(z);
			} else if (x == 1) {
				int y = sc.nextInt();
				if (A.get(y).size() != 0) {
					System.out.println(A.get(y).get(A.get(y).size() - 1));
				}
			} else if (x == 2) {
				int y = sc.nextInt();
				if (A.get(y).size() != 0) {
					A.get(y).remove(A.get(y).size() - 1);
				}
			}
		}
		sc.close();

	}

}

import java.util.Scanner;

public class Main {

	public static class BIT {
		int[] dat;

		public BIT(int n){
			dat = new int[n + 1];
		}

		public void add(int k, int a){
			for(int i = k + 1; i < dat.length; i += i & -i){
				dat[i] += a;
			}
		}

		public int sum(int s, int t){
			if(s > 0) return sum(0, t) - sum(0, s);

			int ret = 0;
			for(int i = t; i > 0; i -= i & -i) {
				ret += dat[i];
			}
			return ret;
		}

		public int get(int k){
			int p = Integer.highestOneBit(dat.length - 1);
			for(int q = p; q > 0; q >>= 1, p |= q){
				if( p >= dat.length || k < dat[p]) p ^= q;
				else k -= dat[p];
			}
			return p;
		}
	}

	public static void main(String[] args){
		Scanner sc = new Scanner(System.in);

		while(true){
			final int n = sc.nextInt();
			final int k = sc.nextInt();

			if(n == 0 && k == 0){
				break;
			}

			BIT bit = new BIT(n);
			for(int i = 0; i < n; i++){
				bit.add(i, sc.nextInt());
			}

			int max = Integer.MIN_VALUE;
			for(int start = 0; start < n - k + 1; start++){
				max = Math.max(max, bit.sum(start, start + k));
			}

		System.out.println(max);
		}
	}
}

