    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        double x = 0.0, y = 0.0;
        double angle = 0.0;

        while (true) {
            String line = sc.nextLine().trim();
            if (line.equals("0,0") || line.equals("0, 0")) break;
            String[] parts = line.split(",");
            int d = Integer.parseInt(parts[0].trim());
            int t = Integer.parseInt(parts[1].trim());

            double rad = Math.toRadians(angle);
            x += d * Math.sin(rad);
            y += d * Math.cos(rad);

            angle += t;
        }

        System.out.println((int)x);
        System.out.println((int)y);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int n = sc.nextInt();
            if (n == 0) break;

            int[][] table = new int[n][n];
            int[] rowSum = new int[n];
            int[] colSum = new int[n];
            int totalSum = 0;

            for (int i = 0; i < n; i++) {
                for (int j = 0; j < n; j++) {
                    table[i][j] = sc.nextInt();
                    rowSum[i] += table[i][j];
                    colSum[j] += table[i][j];
                    totalSum += table[i][j];
                }
            }

            for (int i = 0; i < n; i++) {
                for (int j = 0; j < n; j++) {
                    System.out.printf("%5d", table[i][j]);
                }
                System.out.printf("%5d\n", rowSum[i]);
            }

            for (int j = 0; j < n; j++) {
                System.out.printf("%5d", colSum[j]);
            }
            System.out.printf("%5d\n", totalSum);
        }
    }
}

