public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int[] coins = new int[6];
        for (int i = 0; i < 6; i++) {
            coins[i] = sc.nextInt();
        }
        int[] values = {1, 5, 10, 50, 100, 500};
        int sum = 0;
        for (int i = 0; i < 6; i++) {
            sum += coins[i] * values[i];
        }
        System.out.println(sum >= 1000 ? 1 : 0);
    }
}

