import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int n = sc.nextInt();
            if (n == 0) break;

            int scoreA = 0, scoreB = 0;

            for (int i = 0; i < n; i++) {
                int a = sc.nextInt();
                int b = sc.nextInt();

                if (a > b) {
                    scoreA += a + b;
                } else if (a < b) {
                    scoreB += a + b;
                } else {
                    scoreA += a;
                    scoreB += b;
                }
            }

            System.out.println(scoreA + " " + scoreB);
        }
    }
}

