import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int[] coins = {500, 100, 50, 10, 5, 1};
        while (true) {
            int n = sc.nextInt();
            if (n == 0) break;
            int change = 1000 - n;
            int count = 0;
            for (int coin : coins) {
                count += change / coin;
                change %= coin;
            }
            System.out.println(count);
        }
    }
}

