public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        Set setS = new HashSet<>();
        for (int i = 0; i < n; i++) {
            setS.add(sc.nextInt());
        }
        int q = sc.nextInt();
        int count = 0;
        for (int i = 0; i < q; i++) {
            int t = sc.nextInt();
            if (setS.contains(t)) count++;
        }
        System.out.println(count);
    }
}

