        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int X = sc.nextInt();
        int T = sc.nextInt();

        int batches = (N + X - 1) / X;
        System.out.println(batches * T);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int K = sc.nextInt();
        int mod = 0;
        for (int i = 1; i <= K; i++) {
            mod = (mod * 10 + 7) % K;
            if (mod == 0) {
                System.out.println(i);
                return;
            }
        }
        System.out.println(-1);
    }
}

