import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int[] H = new int[N];
        for (int i = 0; i < N; i++) {
            H[i] = sc.nextInt();
        }

        boolean possible = true;
        for (int i = N - 2; i >= 0; i--) {
            if (H[i] > H[i+1]) {
                H[i]--;
            }
            if (H[i] > H[i+1]) {
                possible = false;
                break;
            }
        }
        System.out.println(possible ? "Yes" : "No");
    }
}

