import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int[] A = new int[N];
        int max1 = -1, max2 = -1;
        for (int i = 0; i < N; i++) {
            A[i] = sc.nextInt();
            if (A[i] > max1) {
                max2 = max1;
                max1 = A[i];
            } else if (A[i] > max2) {
                max2 = A[i];
            }
        }
        for (int i = 0; i < N; i++) {
            if (A[i] == max1) {
                System.out.println(max2);
            } else {
                System.out.println(max1);
            }
        }
    }
}

