import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int sum = 0, temp = N;
        while (temp > 0) {
            sum += temp % 10;
            temp /= 10;
        }
        System.out.println(N % sum == 0 ? "Yes" : "No");
    }
}

