import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String X = sc.next();
        String Y = sc.next();
        int xVal = Integer.parseInt(X, 16);
        int yVal = Integer.parseInt(Y, 16);

        if (xVal < yVal) {
            System.out.println("<");
        } else if (xVal > yVal) {
            System.out.println(">");
        } else {
            System.out.println("=");
        }
    }
}

