public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int x = sc.nextInt();
        int a = sc.nextInt();
        int b = sc.nextInt();

        int distA = (x - a) * (x - a);
        int distB = (x - b) * (x - b);

        System.out.println(distA < distB ? "A" : "B");
    }
}

