import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String S = sc.next();
        boolean[] present = new boolean[26];
        for (char c : S.toCharArray()) {
            present[c - 'a'] = true;
        }
        for (int i = 0; i < 26; i++) {
            if (!present[i]) {
                System.out.println((char)('a' + i));
                return;
            }
        }
        System.out.println("None");
    }
}

