import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String S = sc.next();

        int transitions = 0;
        char prev = S.charAt(0);
        for (int i = 1; i < S.length(); i++) {
            if (S.charAt(i) != prev) {
                transitions++;
                prev = S.charAt(i);
            }
        }

        System.out.println(transitions);
    }
}

