public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (sc.hasNext()) {
            int a = sc.nextInt();
            int b = sc.nextInt();
            int n = sc.nextInt();

            int sum = 0;
            int remainder = a % b;

            for (int i = 0; i < n; i++) {
                remainder *= 10;
                int digit = remainder / b;
                sum += digit;
                remainder = remainder % b;
            }

            System.out.println(sum);
        }

        sc.close();
    }
