import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int H = sc.nextInt();
            int W = sc.nextInt();

            if (H == 0 && W == 0) break;

            char[][] grid = new char[H][W];
            for (int i = 0; i < H; i++) {
                grid[i] = sc.next().toCharArray();
            }

            Set visited = new HashSet<>();
            int x = 0, y = 0;

            while (true) {
                String pos = x + "," + y;
                if (visited.contains(pos)) {
                    System.out.println("LOOP");
                    break;
                }
                visited.add(pos);

                char tile = grid[y][x];
                if (tile == '.') {
                    System.out.println(x + " " + y);
                    break;
                }

                switch (tile) {
                    case '>': x++; break;
                    case '<': x--; break;
                    case '^': y--; break;
                    case 'v': y++; break;
                }
            }
        }

        sc.close();
    }
}

