import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int m = sc.nextInt();
        int n = sc.nextInt();

        List<List> graph = new ArrayList<>();
        int[] indegree = new int[m + 1];

        for (int i = 0; i <= m; i++) {
            graph.add(new ArrayList<>());
        }

        for (int i = 0; i < n; i++) {
            int x = sc.nextInt();
            int y = sc.nextInt();
            graph.get(x).add(y);
            indegree[y]++;
        }

        Queue queue = new LinkedList<>();
        for (int i = 1; i <= m; i++) {
            if (indegree[i] == 0) {
                queue.offer(i);
            }
        }

        List result = new ArrayList<>();
        while (!queue.isEmpty()) {
            int curr = queue.poll();
            result.add(curr);

            for (int next : graph.get(curr)) {
                indegree[next]--;
                if (indegree[next] == 0) {
                    queue.offer(next);
                }
            }
        }

        for (int suspect : result) {
            System.out.println(suspect);
        }
    }
}

