import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int n = sc.nextInt();
            if (n == 0) break;

            int[] count = new int[10];
            for (int i = 0; i < n; i++) {
                int type = sc.nextInt();
                count[type]++;
            }

            for (int i = 0; i < 10; i++) {
                if (count[i] == 0) {
                    System.out.println("-");
                } else {
                    System.out.println("*".repeat(count[i]));
                }
            }
        }

        sc.close();
    }
}

