import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (sc.hasNext()) {
            String s = sc.next();
            int joiCount = 0;
            int ioiCount = 0;

            for (int i = 0; i <= s.length() - 3; i++) {
                String sub = s.substring(i, i + 3);
                if (sub.equals("JOI")) {
                    joiCount++;
                } else if (sub.equals("IOI")) {
