import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int M = sc.nextInt();
        int N = sc.nextInt();
        int K = sc.nextInt();

        char[][] grid = new char[M][N];
        for (int i = 0; i < M; i++) {
            String line = sc.next();
            for (int j = 0; j < N; j++) {
                grid[i][j] = line.charAt(j);
            }
        }

        int[][][] prefix = new int[3][M + 1][N + 1];

        for (int i = 1; i <= M; i++) {
            for (int j = 1; j <= N; j++) {
                char terrain = grid[i - 1][j - 1];

                for (int t = 0; t < 3; t++) {
                    prefix[t][i][j] = prefix[t][i - 1][j] + prefix[t][i][j - 1] - prefix[t][i - 1][j - 1];
                }

                if (terrain == 'J') {
                    prefix[0][i][j]++;
                } else if (terrain == 'O') {
                    prefix[1][i][j]++;
                } else if (terrain == 'I') {
                    prefix[2][i][j]++;
                }
            }
        }

        for (int q = 0; q < K; q++) {
            int a = sc.nextInt();
            int b = sc.nextInt();
            int c = sc.nextInt();
            int d = sc.nextInt();

            int[] counts = new int[3];
            for (int t = 0; t < 3; t++) {
                counts[t] = prefix[t][c][d] - prefix[t][a - 1][d] - prefix[t][c][b - 1] + prefix[t][a - 1][b - 1];
            }

            System.out.println(counts[0] + " " + counts[1] + " " + counts[2]);
        }

        sc.close();
    }
}

