import java.util.Scanner;

public class Main {
    private static long inversions = 0;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] arr = new int[n];

        for (int i = 0; i < n; i++) {
            arr[i] = sc.nextInt();
        }

        mergeSort(arr, 0, n - 1);
        System.out.println(inversions);
    }

    private static void mergeSort(int[] arr, int left, int right) {
        if (left < right) {
            int mid = left + (right - left) / 2;
            mergeSort(arr, left, mid);
            mergeSort(arr, mid + 1, right);
            merge(arr, left, mid, right);
        }
    }

    private static void merge(int[] arr, int left, int mid, int right) {
        int[] temp = new int[right - left + 1];
        int i = left, j = mid + 1, k = 0;

        while (i <= mid && j <= right) {
            if (arr[i] <= arr[j]) {
                temp[k++] = arr[i++];
            } else {
                temp[k++] = arr[j++];
                inversions += (mid - i + 1);
            }
        }

        while (i <= mid) {
            temp[k++] = arr[i++];
        }

        while (j <= right) {
            temp[k++] = arr[j++];
        }

        for (i = left; i <= right; i++) {
            arr[i] = temp[i - left];
        }
    }
}

import java.util.Scanner;

public class Main {
    private static long inversions = 0;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] arr = new int[n];

        for (int i = 0; i < n; i++) {
            arr[i] = sc.nextInt();
        }

        mergeSort(arr, 0, n - 1);
        System.out.println(inversions);
    }

    private static void mergeSort(int[] arr, int left, int right) {
        if (left < right) {
            int mid = left + (right - left) / 2;
            mergeSort(arr, left, mid);
            mergeSort(arr, mid + 1, right);
            merge(arr, left, mid, right);
        }
    }

    private static void merge(int[] arr, int left, int mid, int right) {
        int[] temp = new int[right - left + 1];
        int i = left, j = mid + 1, k = 0;

        while (i <= mid && j <= right) {
            if (arr[i] <= arr[j]) {
                temp[k++] = arr[i++];
            } else {
                temp[k++] = arr[j++];
                inversions += (mid - i + 1);
            }
        }

        while (i <= mid) {
            temp[k++] = arr[i++];
        }

        while (j <= right) {
            temp[k++] = arr[j++];
        }

        for (i = left; i <= right; i++) {
            arr[i] = temp[i - left];
        }
    }
}

import java.util.*;

public class Main {
    static class Node {
        int key, priority;
        Node left, right;

        Node(int key, int priority) {
            this.key = key;
            this.priority = priority;
            this.left = null;
            this.right = null;
        }
    }

    static class Treap {
        Node root;

        Treap() {
            root = null;
        }

        Node rightRotate(Node t) {
            Node s = t.left;
            t.left = s.right;
            s.right = t;
            return s;
        }

        Node leftRotate(Node t) {
            Node s = t.right;
            t.right = s.left;
            s.left = t;
            return s;
        }

        Node insert(Node t, int key, int priority) {
            if (t == null) {
                return new Node(key, priority);
            }
            if (key == t.key) {
                return t;
            }

            if (key < t.key) {
                t.left = insert(t.left, key, priority);
                if (t.priority < t.left.priority) {
                    t = rightRotate(t);
                }
            } else {
                t.right = insert(t.right, key, priority);
                if (t.priority < t.right.priority) {
                    t = leftRotate(t);
                }
            }
            return t;
        }

        Node delete(Node t, int key) {
            if (t == null) {
                return null;
            }
            if (key < t.key) {
                t.left = delete(t.left, key);
            } else if (key > t.key) {
                t.right = delete(t.right, key);
            } else {
                return _delete(t, key);
            }
            return t;
        }

        Node _delete(Node t, int key) {
            if (t.left == null && t.right == null) {
                return null;
            } else if (t.left == null) {
                t = leftRotate(t);
            } else if (t.right == null) {
                t = rightRotate(t);
            } else {
                if (t.left.priority > t.right.priority) {
                    t = rightRotate(t);
                } else {
                    t = leftRotate(t);
                }
            }
            return delete(t, key);
        }

        boolean find(Node t, int key) {
            if (t == null) {
                return false;
            }
            if (key == t.key) {
                return true;
            } else if (key < t.key) {
                return find(t.left, key);
            } else {
                return find(t.right, key);
            }
        }

        void inorder(Node t, List result) {
            if (t != null) {
                inorder(t.left, result);
                result.add(t.key);
                inorder(t.right, result);
            }
        }

        void preorder(Node t, List result) {
            if (t != null) {
                result.add(t.key);
                preorder(t.left, result);
                preorder(t.right, result);
            }
        }

        void insert(int key, int priority) {
            root = insert(root, key, priority);
        }

        void delete(int key) {
            root = delete(root, key);
        }

        boolean find(int key) {
            return find(root, key);
        }

        void print() {
            List inorderResult = new ArrayList<>();
            List preorderResult = new ArrayList<>();

            inorder(root, inorderResult);
            preorder(root, preorderResult);

            for (int key : inorderResult) {
                System.out.print(" " + key);
            }
            System.out.println();

            for (int key : preorderResult) {
                System.out.print(" " + key);
            }
            System.out.println();
        }
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int m = sc.nextInt();
        Treap treap = new Treap();

        for (int i = 0; i < m; i++) {
            String operation = sc.next();

            if (operation.equals("insert")) {
                int k = sc.nextInt();
                int p = sc.nextInt();
                treap.insert(k, p);
            } else if (operation.equals("find")) {
                int k = sc.nextInt();
                if (treap.find(k)) {
                    System.out.println("yes");
                } else {
                    System.out.println("no");
                }
            } else if (operation.equals("delete")) {
                int k = sc.nextInt();
                treap.delete(k);
            } else if (operation.equals("print")) {
                treap.print();
            }
        }

        sc.close();
    }
}

