import java.util.*;

public class Main {
    static List[] graph;
    static int[] match;
    static boolean[] used;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int X = sc.nextInt();
        int Y = sc.nextInt();
        int E = sc.nextInt();

        graph = new List[X];
        for (int i = 0; i < X; i++) {
            graph[i] = new ArrayList<>();
        }

        for (int i = 0; i < E; i++) {
            int x = sc.nextInt();
            int y = sc.nextInt();
            graph[x].add(y);
        }

        match = new int[Y];
        Arrays.fill(match, -1);

        int result = 0;
        for (int i = 0; i < X; i++) {
            used = new boolean[Y];
            if (dfs(i)) {
                result++;
            }
        }

        System.out.println(result);
    }

    static boolean dfs(int v) {
        for (int to : graph[v]) {
            if (used[to]) continue;
            used[to] = true;

            if (match[to] == -1 || dfs(match[to])) {
                match[to] = v;
                return true;
            }
        }
        return false;
    }
}

