import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int K = sc.nextInt();

        Set seen = new HashSet<>();
        int remainder = 0;
        int position = 0;

        while (true) {
            remainder = (remainder * 10 + 7) % K;
            position++;

            if (remainder == 0) {
                System.out.println(position);
                return;
            }

            if (seen.contains(remainder)) {
                System.out.println(-1);
                return;
            }

            seen.add(remainder);
        }
    }
}

