public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        String s = sc.next();

        Set pinCodes = new HashSet<>();

        for (int i = 0; i < n - 2; i++) {
            for (int j = i + 1; j < n - 1; j++) {
                for (int k = j + 1; k < n; k++) {
                    String pin = "" + s.charAt(i) + s.charAt(j) + s.charAt(k);
                    pinCodes.add(pin);
                }
            }
        }

        System.out.println(pinCodes.size());
    }
}

