import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] p = new int[n];

        for (int i = 0; i < n; i++) {
            p[i] = sc.nextInt();
        }

        int count = 0;

        for (int i = 1; i < n - 1; i++) {
            int[] three = {p[i-1], p[i], p[i+1]};
            Arrays.sort(three);

            if (p[i] == three[1]) {
                count++;
            }
        }

        System.out.println(count);
    }
}

