import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int X = sc.nextInt();
        int Y = sc.nextInt();
        int Z = sc.nextInt();
        int K = sc.nextInt();

        long[] A = new long[X];
        long[] B = new long[Y];
        long[] C = new long[Z];

        for (int i = 0; i < X; i++) {
            A[i] = sc.nextLong();
        }
        for (int i = 0; i < Y; i++) {
            B[i] = sc.nextLong();
        }
        for (int i = 0; i < Z; i++) {
            C[i] = sc.nextLong();
        }

        Arrays.sort(A);
        Arrays.sort(B);
        Arrays.sort(C);
        for (int i = 0; i < X / 2; i++) {
            long temp = A[i];
            A[i] = A[X - 1 - i];
            A[X - 1 - i] = temp;
        }
        for (int i = 0; i < Y / 2; i++) {
            long temp = B[i];
            B[i] = B[Y - 1 - i];
            B[Y - 1 - i] = temp;
        }
        for (int i = 0; i < Z / 2; i++) {
            long temp = C[i];
            C[i] = C[Z - 1 - i];
            C[Z - 1 - i] = temp;
        }

        PriorityQueue pq = new PriorityQueue<>((a, b) -> Long.compare(b[0], a[0]));
        Set visited = new HashSet<>();

        pq.offer(new long[]{A[0] + B[0] + C[0], 0, 0, 0});
        visited.add("0,0,0");

        for (int count = 0; count < K; count++) {
            long[] current = pq.poll();
            long sum = current[0];
            int i = (int)current[1];
            int j = (int)current[2];
            int k = (int)current[3];

            System.out.println(sum);

            if (i + 1 < X && !visited.contains((i + 1) + "," + j + "," + k)) {
                pq.offer(new long[]{A[i + 1] + B[j] + C[k], i + 1, j, k});
                visited.add((i + 1) + "," + j + "," + k);
            }
            if (j + 1 < Y && !visited.contains(i + "," + (j + 1) + "," + k)) {
                pq.offer(new long[]{A[i] + B[j + 1] + C[k], i, j + 1, k});
                visited.add(i + "," + (j + 1) + "," + k);
            }
            if (k + 1 < Z && !visited.contains(i + "," + j + "," + (k + 1))) {
                pq.offer(new long[]{A[i] + B[j] + C[k + 1], i, j, k + 1});
                visited.add(i + "," + j + "," + (k + 1));
            }
        }
    }
}

