import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        long W = sc.nextLong();

        int[] w = new int[N];
        int[] v = new int[N];
        int totalValue = 0;

        for (int i = 0; i < N; i++) {
            w[i] = sc.nextInt();
            v[i] = sc.nextInt();
            totalValue += v[i];
        }

        long[][] dp = new long[N + 1][totalValue + 1];

        for (int i = 0; i <= N; i++) {
            Arrays.fill(dp[i], Long.MAX_VALUE);
        }

        for (int i = 0; i <= N; i++) {
            dp[i][0] = 0;
        }

        for (int i = 1; i <= N; i++) {
            for (int j = 0; j <= totalValue; j++) {
                dp[i][j] = dp[i-1][j];

                if (j >= v[i-1] && dp[i-1][j - v[i-1]] != Long.MAX_VALUE) {
                    dp[i][j] = Math.min(dp[i][j], dp[i-1][j - v[i-1]] + w[i-1]);
                }
            }
        }

        int maxValue = 0;
        for (int j = 0; j <= totalValue; j++) {
            if (dp[N][j] <= W) {
                maxValue = j;
            }
        }

        System.out.println(maxValue);
    }
}

