import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int T = sc.nextInt();

        int minCost = Integer.MAX_VALUE;
        boolean found = false;

        for (int i = 0; i < N; i++) {
            int cost = sc.nextInt();
            int time = sc.nextInt();

            if (time <= T) {
                found = true;
                minCost = Math.min(minCost, cost);
            }
        }

        if (found) {
            System.out.println(minCost);
        } else {
            System.out.println("TLE");
        }

        sc.close();
    }
}

