import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int M = sc.nextInt();
        int Q = sc.nextInt();

        int[][] count = new int[N + 1][N + 1];

        for (int i = 0; i < M; i++) {
            int L = sc.nextInt();
            int R = sc.nextInt();

            for (int p = 1; p <= L; p++) {
                for (int q = R; q <= N; q++) {
                    count[p][q]++;
                }
            }
        }

        for (int i = 0; i < Q; i++) {
            int p = sc.nextInt();
            int q = sc.nextInt();
            System.out.println(count[p][q]);
        }

        sc.close();
    }
}

