            int L = sc.nextInt();
            int R = sc.nextInt();

            for (int p = 1; p <= L; p++) {
                for (int q = R; q <= N; q++) {
                    count[p][q]++;
                }
            }
        }

        for (int i = 0; i < Q; i++) {
            int p = sc.nextInt();
            int q = sc.nextInt();
            System.out.println(count[p][q]);
        }

        sc.close();
    }
}

