import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] b = new int[n];

        for (int i = 0; i < n; i++) {
            int a = sc.nextInt();
            b[i] = a - (i + 1);
        }

        Arrays.sort(b);

        int median = b[(n - 1) / 2];

        long sadness = 0;
        for (int i = 0; i < n; i++) {
            sadness += Math.abs(b[i] - median);
        }

        System.out.println(sadness);
    }
}

