public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long A = sc.nextLong();
        long B = sc.nextLong();
        int K = sc.nextInt();

        Set result = new TreeSet<>();

        for (int i = 0; i < K && A + i <= B; i++) {
            result.add(A + i);
        }

        for (int i = 0; i < K && B - i >= A; i++) {
            result.add(B - i);
        }

        for (long num : result) {
            System.out.println(num);
        }
    }
}

