        int totalEaten = 0;

        for (int i = 0; i < N; i++) {
            int A = sc.nextInt();
            int chocolatesEaten = (D - 1) / A + 1;
            totalEaten += chocolatesEaten;
        }

        System.out.println(totalEaten + X);

        sc.close();
    }
}

