import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int M = sc.nextInt();
        int K = sc.nextInt();

        for (int r = 0; r <= N; r++) {
            for (int c = 0; c <= M; c++) {
                int blackSquares = r * M + c * N - 2 * r * c;
                if (blackSquares == K) {
                    System.out.println("Yes");
                    return;
                }
            }
        }

        System.out.println("No");
    }
}

