public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int K = sc.nextInt();

        int totalDistance = 0;

        for (int i = 0; i < N; i++) {
            int x = sc.nextInt();

            int costA = 2 * x;

            int costB = 2 * (K - x);

            totalDistance += Math.min(costA, costB);
        }

        System.out.println(totalDistance);
        sc.close();
    }
