import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] a = new int[n];

        Set candidates = new HashSet<>();

        for (int i = 0; i < n; i++) {
            a[i] = sc.nextInt();
            candidates.add(a[i] - 1);
            candidates.add(a[i]);
            candidates.add(a[i] + 1);
        }

        int maxCount = 0;

        for (int x : candidates) {
            int count = 0;
            for (int i = 0; i < n; i++) {
                if (Math.abs(a[i] - x) <= 1) {
                    count++;
                }
            }
            maxCount = Math.max(maxCount, count);
        }

        System.out.println(maxCount);
    }
}

