        int[] p = new int[n];

        for (int i = 0; i < n; i++) {
            p[i] = sc.nextInt();
        }

        int operations = 0;
        int i = 0;

        while (i < n) {
            if (p[i] == i + 1) {
                int segmentLength = 0;
                while (i < n && p[i] == i + 1) {
                    segmentLength++;
                    i++;
                }
                operations += (segmentLength + 1) / 2;
            } else {
                i++;
            }
        }

        System.out.println(operations);
    }
}

