import java.util.*;

public class Main {
    static class Edge implements Comparable {
        int u, v, cost;

        Edge(int u, int v, int cost) {
            this.u = u;
            this.v = v;
            this.cost = cost;
        }

        public int compareTo(Edge other) {
            return Integer.compare(this.cost, other.cost);
        }
    }

    static class UnionFind {
        int[] parent, rank;

        UnionFind(int n) {
            parent = new int[n];
            rank = new int[n];
            for (int i = 0; i < n; i++) {
                parent[i] = i;
            }
        }

        int find(int x) {
            if (parent[x] != x) {
                parent[x] = find(parent[x]);
            }
            return parent[x];
        }

        boolean union(int x, int y) {
            int px = find(x), py = find(y);
            if (px == py) return false;

            if (rank[px] < rank[py]) {
                parent[px] = py;
            } else if (rank[px] > rank[py]) {
                parent[py] = px;
            } else {
                parent[py] = px;
                rank[px]++;
            }
            return true;
        }
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();

        int[][] towns = new int[n][3];
        for (int i = 0; i < n; i++) {
            towns[i][0] = sc.nextInt();
            towns[i][1] = sc.nextInt();
            towns[i][2] = i;
        }

        List edges = new ArrayList<>();

        Arrays.sort(towns, (a, b) -> Integer.compare(a[0], b[0]));
        for (int i = 0; i < n - 1; i++) {
            int cost = Math.min(Math.abs(towns[i][0] - towns[i+1][0]),
                               Math.abs(towns[i][1] - towns[i+1][1]));
            edges.add(new Edge(towns[i][2], towns[i+1][2], cost));
        }

        Arrays.sort(towns, (a, b) -> Integer.compare(a[1], b[1]));
        for (int i = 0; i < n - 1; i++) {
            int cost = Math.min(Math.abs(towns[i][0] - towns[i+1][0]),
                               Math.abs(towns[i][1] - towns[i+1][1]));
            edges.add(new Edge(towns[i][2], towns[i+1][2], cost));
        }

        Collections.sort(edges);
        UnionFind uf = new UnionFind(n);
        long totalCost = 0;
        int edgesUsed = 0;

        for (Edge edge : edges) {
            if (uf.union(edge.u, edge.v)) {
                totalCost += edge.cost;
                edgesUsed++;
                if (edgesUsed == n - 1) break;
            }
        }

        System.out.println(totalCost);
    }
}

