import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();

        long takahashi = 0;
        long aoki = 0;

        for (int i = 0; i < n; i++) {
            long t = sc.nextLong();
            long a = sc.nextLong();

            if (i == 0) {
                takahashi = t;
                aoki = a;
            } else {
                long k1 = (takahashi + t - 1) / t;
                long k2 = (aoki + a - 1) / a;
                long k = Math.max(k1, k2);

                takahashi = k * t;
                aoki = k * a;
            }
        }

        System.out.println(takahashi + aoki);
        sc.close();
    }
}

