            if (C > D) {
                points[A] += 3;
            } else if (C < D) {
                points[B] += 3;
            } else {
                points[A] += 1;
                points[B] += 1;
            }
        }

        List teams = new ArrayList<>();
        for (int i = 1; i <= N; i++) {
            teams.add(new Team(i, points[i]));
        }

        Collections.sort(teams, (a, b) -> b.points - a.points);

        int[] ranks = new int[N + 1];
