public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int[] A = new int[N];
        for (int i = 0; i < N; i++) {
            A[i] = sc.nextInt();
        }
        long total = 0;
        int maxSoFar = A[0];
        for (int i = 1; i < N; i++) {
            if (A[i] < maxSoFar) {
                total += maxSoFar - A[i];
            } else {
                maxSoFar = A[i];
            }
        }
        System.out.println(total);
    }
}

