        int N = sc.nextInt();
        int[] L = new int[N];
        for (int i = 0; i < N; i++) {
            L[i] = sc.nextInt();
        }

        Arrays.sort(L);
        int count = 0;

        for (int i = 0; i < N; i++) {
            for (int j = i + 1; j < N; j++) {
                if (L[i] == L[j]) continue;
                for (int k = j + 1; k < N; k++) {
                    if (L[j] == L[k] || L[i] == L[k]) continue;
                    if (L[i] + L[j] > L[k]) {
                        count++;
                    }
                }
            }
        }
        System.out.println(count);
    }
}

