import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int M = sc.nextInt();
        int[] H = new int[N + 1];
        for (int i = 1; i <= N; i++) {
            H[i] = sc.nextInt();
        }

        List[] adj = new ArrayList[N + 1];
        for (int i = 1; i <= N; i++) {
            adj[i] = new ArrayList<>();
        }

        for (int i = 0; i < M; i++) {
            int A = sc.nextInt();
            int B = sc.nextInt();
            adj[A].add(B);
            adj[B].add(A);
        }

        int count = 0;
        for (int i = 1; i <= N; i++) {
            boolean isGood = true;
            for (int neighbor : adj[i]) {
                if (H[i] <= H[neighbor]) {
                    isGood = false;
                    break;
                }
            }
            if (isGood) {
                count++;
            }
        }
        System.out.println(count);
    }
}

