import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int N = scanner.nextInt();
        int[] W = new int[N];
        for (int i = 0; i < N; i++) {
            W[i] = scanner.nextInt();
        }

        int minDiff = Integer.MAX_VALUE;
        for (int T = 1; T < N; T++) {
            int sum1 = 0;
            for (int i = 0; i < T; i++) {
                sum1 += W[i];
            }
            int sum2 = 0;
            for (int i = T; i < N; i++) {
                sum2 += W[i];
            }
            int diff = Math.abs(sum1 - sum2);
            if (diff < minDiff) {
                minDiff = diff;
            }
        }
        System.out.println(minDiff);
    }
}

