import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int N = scanner.nextInt();
        int[] V = new int[N];
        int[] C = new int[N];

        for (int i = 0; i < N; i++) {
            V[i] = scanner.nextInt();
        }
        for (int i = 0; i < N; i++) {
            C[i] = scanner.nextInt();
        }

        int max = 0;
        for (int mask = 0; mask < (1 << N); mask++) {
            int X = 0, Y = 0;
            for (int i = 0; i < N; i++) {
                if ((mask & (1 << i)) != 0) {
                    X += V[i];
                    Y += C[i];
                }
            }
            max = Math.max(max, X - Y);
        }
        System.out.println(max);
    }
}

