public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int T = sc.nextInt();
        int minCost = Integer.MAX_VALUE;
        boolean found = false;

        for (int i = 0; i < N; i++) {
            int c = sc.nextInt();
            int t = sc.nextInt();
            if (t <= T && c < minCost) {
                minCost = c;
                found = true;
            }
        }

        if (found) {
            System.out.println(minCost);
        } else {
            System.out.println("TLE");
        }
    }
}

