import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String S = sc.next();
        int[] count = new int[3];

        for (char c : S.toCharArray()) {
            count[c - 'a']++;
        }

        int max = Math.max(count[0], Math.max(count[1], count[2]));
        int total = S.length();

        if (max <= (total + 1) / 2) {
            System.out.println("YES");
        } else {
            System.out.println("NO");
        }
    }
}

