import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int H = sc.nextInt();
        int W = sc.nextInt();
        char[][] grid = new char[H][W];
        for (int i = 0; i < H; i++) {
            grid[i] = sc.next().toCharArray();
        }

        boolean[][] visited = new boolean[H][W];
        int i = 0, j = 0;
        visited[i][j] = true;

        while (i != H - 1 || j != W - 1) {
            boolean moved = false;
            if (j + 1 < W && grid[i][j + 1] == '#' && !visited[i][j + 1]) {
                j++;
                moved = true;
            } else if (i + 1 < H && grid[i + 1][j] == '#' && !visited[i + 1][j]) {
                i++;
                moved = true;
            }
            if (!moved) {
                System.out.println("Impossible");
                return;
            }
            visited[i][j] = true;
        }

        for (int x = 0; x < H; x++) {
            for (int y = 0; y < W; y++) {
                if (grid[x][y] == '#' && !visited[x][y]) {
                    System.out.println("Impossible");
                    return;
                }
            }
        }

        System.out.println("Possible");
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int H = sc.nextInt();
        int W = sc.nextInt();
        char[][] grid = new char[H][W];
        for (int i = 0; i < H; i++) {
            grid[i] = sc.next().toCharArray();
        }

        boolean[][] visited = new boolean[H][W];
        int i = 0, j = 0;
        visited[i][j] = true;

        while (i != H - 1 || j != W - 1) {
            boolean moved = false;
            if (j + 1 < W && grid[i][j + 1] == '#' && !visited[i][j + 1]) {
                j++;
                moved = true;
            } else if (i + 1 < H && grid[i + 1][j] == '#' && !visited[i + 1][j]) {
                i++;
                moved = true;
            }
            if (!moved) {
                System.out.println("Impossible");
                return;
            }
            visited[i][j] = true;
        }

        for (int x = 0; x < H; x++) {
            for (int y = 0; y < W; y++) {
                if (grid[x][y] == '#' && !visited[x][y]) {
                    System.out.println("Impossible");
                    return;
                }
            }
        }
        System.out.println("Possible");
    }
}

