public class Main {

  public static void main(String[] args) {
    Scanner sc = new Scanner(System.in);
    int N = sc.nextInt();
    for (int i = 0; i < N; i++) {
      int[] sides = new int[3];
      sides[0] = sc.nextInt();
      sides[1] = sc.nextInt();
      sides[2] = sc.nextInt();
      Arrays.sort(sides);
      if (sides[0] * sides[0] + sides[1] * sides[1] == sides[2] * sides[2]) {
        System.out.println("YES");
      } else {
        System.out.println("NO");
      }
    }
    sc.close();
  }
}

