import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int m = sc.nextInt();
        int n = sc.nextInt();

        List<List> adj = new ArrayList<>();
        for (int i = 0; i <= m; i++) {
            adj.add(new ArrayList<>());
        }

        int[] inDegree = new int[m + 1];

        for (int i = 0; i < n; i++) {
            int x = sc.nextInt();
            int y = sc.nextInt();
            adj.get(x).add(y);
            inDegree[y]++;
        }

        Queue q = new LinkedList<>();
        for (int i = 1; i <= m; i++) {
            if (inDegree[i] == 0) {
                q.offer(i);
            }
        }

        List result = new ArrayList<>();
        while (!q.isEmpty()) {
            int u = q.poll();
            result.add(u);

            for (int v : adj.get(u)) {
                inDegree[v]--;
                if (inDegree[v] == 0) {
                    q.offer(v);
                }
            }
        }

        for (int person : result) {
            System.out.println(person);
        }

        sc.close();
    }
}

