                break;
            }

            int[] ageGroups = new int[7];

            for (int i = 0; i < n; i++) {
                int age = sc.nextInt();
                if (age >= 0 && age <= 9) {
                    ageGroups[0]++;
                } else if (age >= 10 && age <= 19) {
                    ageGroups[1]++;
                } else if (age >= 20 && age <= 29) {
                    ageGroups[2]++;
