                    ageGroups[3]++;
                } else if (age >= 40 && age <= 49) {
                    ageGroups[4]++;
                } else if (age >= 50 && age <= 59) {
                    ageGroups[5]++;
                } else if (age >= 60) {
                    ageGroups[6]++;
                }
            }

            for (int count : ageGroups) {
                System.out.println(count);
            }
        }
        sc.close();
    }
}

