import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            long a = sc.nextLong();
            long b = sc.nextLong();

            if (a == 0 && b == 0) {
                break;
            }

            long x = a;
            long y = b;
            int steps = 0;

            while (y != 0) {
                long temp = y;
                y = x % y;
                x = temp;
                steps++;
            }
            System.out.println(x + " " + steps);
        }
        sc.close();
    }
}

