        int K = sc.nextInt();

        for (int i = 0; i < K; i++) {
            int a = sc.nextInt();
            int b = sc.nextInt();

            int dist = Math.min(Math.min(a - 1, N - a), Math.min(b - 1, N - b));

            int color = (dist % 3) + 1;
