import java.util.Scanner;

public class Main {

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int n = sc.nextInt();
        int[] a = new int[n];
        for (int i = 0; i < n; i++) {
            a[i] = sc.nextInt();
        }

        int m = sc.nextInt();
        int[] b = new int[m];
        for (int i = 0; i < m; i++) {
            b[i] = sc.nextInt();
        }

        int minLen = Math.min(n, m);
        for (int i = 0; i < minLen; i++) {
            if (a[i] < b[i]) {
                System.out.println(1);
                return;
            } else if (a[i] > b[i]) {
                System.out.println(0);
                return;
            }
        }

        if (n < m) {
            System.out.println(1);
        } else {
            System.out.println(0);
        }
    }
}

