import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int X = sc.nextInt();
        int Y = sc.nextInt();
        int A = sc.nextInt();
        int B = sc.nextInt();
        int C = sc.nextInt();

        Integer[] p = new Integer[A];
        for (int i = 0; i < A; i++) {
            p[i] = sc.nextInt();
        }
        Integer[] q = new Integer[B];
        for (int i = 0; i < B; i++) {
            q[i] = sc.nextInt();
        }
        Integer[] r = new Integer[C];
        for (int i = 0; i < C; i++) {
            r[i] = sc.nextInt();
        }

        Arrays.sort(p, Collections.reverseOrder());
        Arrays.sort(q, Collections.reverseOrder());
        Arrays.sort(r, Collections.reverseOrder());

        List allApples = new ArrayList<>();
        for (int i = 0; i < X; i++) {
            allApples.add(p[i]);
        }
        for (int i = 0; i < Y; i++) {
            allApples.add(q[i]);
        }
        for (int val : r) {
            allApples.add(val);
        }

        Collections.sort(allApples, Collections.reverseOrder());

        long sum = 0;
        for (int i = 0; i < X + Y; i++) {
            sum += allApples.get(i);
        }

        System.out.println(sum);

        sc.close();
    }
}

