import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();
        int[] p = new int[N];
        for (int i = 0; i < N; i++) {
            p[i] = sc.nextInt();
        }
        sc.close();

        double currentSum = 0;
        for (int i = 0; i < K; i++) {
            currentSum += (double) (p[i] + 1) / 2;
        }

        double maxSum = currentSum;

        for (int i = K; i < N; i++) {
            currentSum += (double) (p[i] + 1) / 2;
            currentSum -= (double) (p[i - K] + 1) / 2;
            if (currentSum > maxSum) {
                maxSum = currentSum;
            }
        }

        System.out.printf("%.12f\n", maxSum);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int K = sc.nextInt();
        int[] p = new int[N];
        for (int i = 0; i < N; i++) {
            p[i] = sc.nextInt();
        }
        sc.close();

        double currentSum = 0;
        for (int i = 0; i < K; i++) {
            currentSum += (double) (p[i] + 1) / 2;
        }

        double maxSum = currentSum;

        for (int i = K; i < N; i++) {
            currentSum += (double) (p[i] + 1) / 2;
            currentSum -= (double) (p[i - K] + 1) / 2;
            if (currentSum > maxSum) {
                maxSum = currentSum;
            }
        }

        System.out.printf("%.12f\n", maxSum);
    }
}

