import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int[] W = new int[N];
        for (int i = 0; i < N; i++) {
            W[i] = sc.nextInt();
        }
        sc.close();

        int minDiff = Integer.MAX_VALUE;

        for (int T = 1; T < N; T++) {
            int S1 = 0;
            for (int i = 0; i < T; i++) {
                S1 += W[i];
            }

            int S2 = 0;
            for (int i = T; i < N; i++) {
                S2 += W[i];
            }

            minDiff = Math.min(minDiff, Math.abs(S1 - S2));
        }

        System.out.println(minDiff);
    }
}

