import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int R = sc.nextInt();
        int G = sc.nextInt();
        int B = sc.nextInt();
        int N = sc.nextInt();
        sc.close();

        long count = 0;
        for (int r = 0; r * R <= N; r++) {
            for (int g = 0; r * R + g * G <= N; g++) {
                int remaining = N - (r * R + g * G);
                if (remaining % B == 0) {
                    count++;
                }
            }
        }
        System.out.println(count);
    }
}

