import java.util.HashSet;
import java.util.Scanner;
import java.util.Set;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int M = sc.nextInt();

        Set commonLikedFoods = new HashSet<>();
        for (int i = 1; i <= M; i++) {
            commonLikedFoods.add(i);
        }

        for (int i = 0; i < N; i++) {
            int K = sc.nextInt();
            Set currentPersonLikedFoods = new HashSet<>();
            for (int j = 0; j < K; j++) {
                currentPersonLikedFoods.add(sc.nextInt());
            }
            commonLikedFoods.retainAll(currentPersonLikedFoods);
        }

        System.out.println(commonLikedFoods.size());
        sc.close();
    }
}

