public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int H = sc.nextInt();
        int W = sc.nextInt();
        sc.close();

        int possibleRows = N - H + 1;

        int possibleCols = N - W + 1;

        long totalWays = (long) possibleRows * possibleCols;

        System.out.println(totalWays);
    }
}

