import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int[] a = new int[N];
        for (int i = 0; i < N; i++) {
            a[i] = sc.nextInt();
        }
        sc.close();

        int spells = 0;
        for (int i = 0; i < N - 1; i++) {
            if (a[i] == a[i + 1]) {
                spells++;
                i++;
            }
        }
        System.out.println(spells);
    }
}

