import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int A = sc.nextInt();
        int B = sc.nextInt();
        sc.close();

        int sum = A + B;
        int difference = A - B;
        int product = A * B;

        int maxVal = Math.max(sum, Math.max(difference, product));
        System.out.println(maxVal);
    }
}

