import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long x = sc.nextLong();
        long y = sc.nextLong();
        sc.close();

        int count = 0;
        long current = x;
        while (current <= y) {
            count++;
            if (y / 2 < current) {
                break;
            }
            current *= 2;
        }
        System.out.println(count);
    }
}

