        int N = sc.nextInt();
        int[] p = new int[N];
        for (int i = 0; i < N; i++) {
            p[i] = sc.nextInt();
        }
        sc.close();

        int operations = 0;
        for (int i = 0; i < N; i++) {
            if (p[i] == i + 1) {
                operations++;
                if (i + 1 < N) {
                    i++;
                }
            }
        }
        System.out.println(operations);
    }
}

