import java.util.Arrays;
import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int[] a = new int[3 * N];
        for (int i = 0; i < 3 * N; i++) {
            a[i] = sc.nextInt();
        }
        sc.close();

        Arrays.sort(a);

        long totalStrength = 0;

        for (int i = 3 * N - 2; i >= N; i -= 2) {
            totalStrength += a[i];
        }

        System.out.println(totalStrength);
    }
}

