import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String s = sc.next();
        sc.close();

        int firstA = -1;
        int lastZ = -1;

        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) == 'A') {
                firstA = i;
                break;
            }
        }

        for (int i = s.length() - 1; i >= 0; i--) {
            if (s.charAt(i) == 'Z') {
                lastZ = i;
                break;
            }
        }

        System.out.println(lastZ - firstA + 1);
    }
}

