        sc.close();

        int count = 0;
        for (int X = 0; X <= K; X++) {
            for (int Y = 0; Y <= K; Y++) {
                int Z = S - X - Y;

                if (Z >= 0 && Z <= K) {
                    count++;
                }
            }
        }
        System.out.println(count);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int[] T = new int[N];
        long totalTime = 0;
        for (int i = 0; i < N; i++) {
            T[i] = sc.nextInt();
            totalTime += T[i];
        }

        int M = sc.nextInt();
        for (int i = 0; i < M; i++) {
            int P = sc.nextInt();
            int X = sc.nextInt();

            long currentTotal = totalTime - T[P - 1] + X;
            System.out.println(currentTotal);
        }

        sc.close();
    }
}

