import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        long x = sc.nextLong();
        long[] a = new long[N];
        for (int i = 0; i < N; i++) {
            a[i] = sc.nextLong();
        }

        long operations = 0;

        if (a[0] + a[1] > x) {
            long diff = (a[0] + a[1]) - x;
            operations += diff;
            a[1] = Math.max(0, a[1] - diff);
        }

        for (int i = 1; i < N - 1; i++) {
            if (a[i] + a[i + 1] > x) {
                long diff = (a[i] + a[i + 1]) - x;
                operations += diff;
                a[i + 1] = Math.max(0, a[i + 1] - diff);
            }
        }

        System.out.println(operations);
        sc.close();
    }
}

